import { useDispatch, useSelector } from "react-redux";
import { getPokemonId } from "../../Redux/Actions/action";
import { useEffect } from "react";

const Detail = (id) => {
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(getPokemonId(id));
  }, []);

  return (
    <div>
      <div>
        <h3>name</h3>
      </div>
      <div>
        <span>Life</span>
        <span>Ataque</span>
        <span>Defense</span>
        <span>Velocity</span>
        <span>Height</span>
        <span></span>
      </div>
    </div>
  );
};
export default Detail;
